import{_ as e,W as a,X as d,a0 as o}from"./framework-0a321081.js";const i={},s=o('<h1 id="debian9-查看端口占用" tabindex="-1"><a class="header-anchor" href="#debian9-查看端口占用" aria-hidden="true">#</a> debian9 查看端口占用</h1><h2 id="ss命令" tabindex="-1"><a class="header-anchor" href="#ss命令" aria-hidden="true">#</a> ss命令</h2><p><code>ss -tulpn</code><br> 如果显示命令不存在则需要安装<code>sudo apt install iproute2</code></p><p>选项</p><ul><li><code>-t, –tcp</code>：查看所有 TCP 套接字</li><li><code>-u, –udp</code>：查看所有 UDP 套接字</li><li><code>-l, –listening</code>：查看所有监听套接字</li><li><code>-p, processes</code>：查看哪些进程正在使用套接字</li><li><code>-n, –numeric</code>：如果您想查看端口号而不是服务名称，请使用此选项</li></ul><h2 id="netstat命令" tabindex="-1"><a class="header-anchor" href="#netstat命令" aria-hidden="true">#</a> netstat命令</h2><p><code>netstat –tulnp</code><br> 如果命令不存在则安装<code>sudo apt-get net-tools</code></p><ul><li>-t, –tcp：查看所有 TCP 套接字</li><li>-u, –udp：查看所有 UDP 套接字</li><li>-l, –listening：查看所有监听套接字</li><li>-p, processes：查看哪些进程正在使用套接字</li><li>-n, –numeric：如果您想查看端口号而不是服务名称，请使用此选项</li></ul><h2 id="lsof命令" tabindex="-1"><a class="header-anchor" href="#lsof命令" aria-hidden="true">#</a> lsof命令</h2><p><code>sudo lsof -nP -iTCP -sTCP:LISTEN</code>,没安装则执行<code>apt-get install lsof</code></p><h2 id="namp命令" tabindex="-1"><a class="header-anchor" href="#namp命令" aria-hidden="true">#</a> namp命令</h2><p><code>sudo apt install nmap</code><br><code>sudo nmap –sT –p-65535 ip-address</code><br> 例如<code>sudo nmap –sT –p-65535 192.168.72.158</code></p>',12),t=[s];function c(n,l){return a(),d("div",null,t)}const p=e(i,[["render",c],["__file","debian9-query-port.html.vue"]]);export{p as default};
